    false,nt"url": null,nt"notes": "Historical records indicate that sea otters
    (Enhydra lutris) were abundant prior to intensive commercial exploitation (1742-
    1911). However, by the end of the 19th century sea otters were nearly extinct. The
    objectives of this survey were to obtain current information on the distribution
    and relative abundance of the Kodiak Archipelago population, and to identify changes
    that have occurred since the 1984 survey (Simon-Jackson et al. 1985). This information
    can be used for predicting future changes likely to cause increasing conflicts with
    management of important fisheries resources. It will also be used to assist the
    U.S. Fish and Wildlife Service in recommending a management program for sea otters.",nt"license_title":
